import React from "react";
const drawerWidth = 240;

export default function PermanentDrawerLeft() {
  return (
    <div className="flex-1">
      <div className="side-bar">
        <Logo />
        <Bars logo="Weather" />
        <Bars logo="Cities" />
        <Bars logo="Maps" />
        <Bars logo="Settings" />
      </div>
    </div>
  );
}

function Logo() {
  return (
    <div className="logo-div">
      <img src="#" alt="app-logo" className="logo-img" />
    </div>
  );
}

function Bars({ logo }) {
  return (
    <div className="bars-div">
      <a href="#" className="page-link">
        <img src="#" alt="bar-image" className="bar-img" />
        <span>{logo}</span>
      </a>
    </div>
  );
}
